package uno;

public class Uno {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int uno = 120;
		int dos = 10;
		System.out.println(uno+dos);
		System.out.println(uno-dos);
		System.out.println(uno*dos);
		System.out.println(uno/dos);
		System.out.println(uno%dos);
	}

}
